import React from "react";
import "./Filter.css";

export default function Filter() {
  return (
    <div className="Filter">
      <div>
        <select>
          <option value="all-brands">All Brands</option>
        </select>
      </div>
      <div>Color</div>
      <div>Weight</div>
      <div>Size</div>
    </div>
  );
}
